import React, { useRef, useEffect, useState } from "react";
import "./Sections.css";
import myImage from "./assets/myImage.png";
import 'bootstrap-icons/font/bootstrap-icons.css';

function Sections() {
  const [showSecondSection, setShowSecondSection] = useState(false);
  const sentinelRef = useRef(null);
  const listRef = useRef(null);
  
  useEffect(() => {
    const list = listRef.current;
    if (window.innerWidth < 768) { // Aplica solo en pantallas peque√±as
      const interval = setInterval(() => {
        list.scrollBy({ left: 250, behavior: "smooth" }); // Auto-scroll
      }, 3000);
      return () => clearInterval(interval); // Limpieza al desmontar
    }
    const observer = new IntersectionObserver(
      ([entry]) => {
        setShowSecondSection(entry.intersectionRatio === 1);
      },
      { threshold: 1.0 }
    );

    if (sentinelRef.current) {
      observer.observe(sentinelRef.current);
    }

    return () => {
      if (sentinelRef.current) {
        observer.unobserve(sentinelRef.current);
      }
    };
  }, []);

  return (
    <div className="sections-container">
      {/* Secci√≥n 1 */}
     <section>
                 <div>
            <img src={myImage} alt="Mi Imagen de Perfil" loading="lazy" />
          </div>
      </section>
      <section className="section-one">
        <h2 className="section-title">About Me</h2>
        <div className="header-container">

          <div className="subsections-description">
            <div className="grey-border-section">
              <p>Venezuela, San Crist√≥bal 2001 üî•</p>
              <p>Nac√≠ en San Crist√≥bal y tengo 24 a√±os. Me interesa seguir estudiando ingenier√≠a inform√°tica y telecomunicaciones.</p>
            </div>
            <div className="grey-border-section">
              <p>Enfoque üéØ</p>
              <p>Me gustar√≠a especializarme en desarrollo web, blockchain y animaciones 3D en videojuegos.</p>
            </div>
            <div className="grey-border-section">
              <h5>üëç Aspectos Positivos</h5>
              <ul>
                <li>üë™ Trabajo en equipo f√°cilmente</li>
                <li>üèÖ Ambiente 100% remoto</li>
                <li>üìå Compilar, ejecutar y probar c√≥digo</li>
                <li>üçâ Uso herramientas como Chat-GPT</li>
                <li>üí¢ Administrador de redes sociales</li>
              </ul>
            </div>
          </div>
        </div>
        <div ref={sentinelRef} className="sentinel"></div>
      </section>

      {/* Secci√≥n 2 */}
      <section className={`section-two ${showSecondSection ? "visible" : ""}`}>
    <div className="title-container">
      <ul ref={listRef} className="suggestion-list">
            <li className="suggestion">
              <h4 className="text">Q&A support</h4>
              <img className="imgembed" src="https://es.stackoverflow.com/users/flair/327285.png"
                alt="Perfil en Stack Overflow" />
            </li>
            <li className="suggestion">
              <h5>Social Networks üë®‚Äçüíª</h5>
              <p><i class="bi bi-youtube"></i><a href="https://www.youtube.com/@dlprisco">@dlprisco</a></p>
              <p><i class="bi bi-facebook"></i><a href="https://www.facebook.com/profile.php?id=100092658256294">prisco</a></p>
              <p><i class="bi bi-instagram"></i><a href="https://www.instagram.com/prisco_pris">@prisco_pris</a></p>
              <p><i class="bi bi-twitter-x"></i><a href="https://www.twitter.com/prisco_pris">@prisco_pris</a></p>
              <p><i class="bi bi-tiktok"></i><a href="https://www.tiktok.com/@prisco_pris">@prisco_pris</a></p>
            </li>
            <li className="suggestion">
              <h5>Problemas de c√≥digo y algoritmos üëæ</h5>
              <p><a href="https://leetcode.com/u/prisco/">LeetCode</a></p>
              <p><a href="https://www.hackerrank.com/profile/jellous">HackerRank</a></p>
              <p><a href="https://www.codewars.com/users/hexorhex">CodeWars</a></p>
            </li>
            <li className="suggestion">
              <h5>Aprendizaje üå¥</h5>
              <p><a href="https://codecademy.com">codecademy</a></p>
              <p><a href="https://udemy.com">Udemy</a></p>
              <p><a href="https://coursera.com">Coursera.org</a></p>
              <p>and more others ...</p>
            </li>
          </ul>
        </div>
      </section>
    </div>
  );
}

export default Sections;
